import React from "react";
// For simplicity, show basic text. You can enhance using separate API later.
const FollowersFollowing = () => {
  return (
    <div className="container">
      <h3>Followers & Following</h3>
      <p>
        This screen can be implemented by creating a dedicated API to fetch
        followers and following lists for the logged-in user, then displaying
        them here.
      </p>
    </div>
  );
};

export default FollowersFollowing;
